script: |
  super -f text -I q11290.spq | sort > q11290.out

inputs:
  - name: q11290.spq
    data: |
      SELECT - col2 * + col1 + - col2 + - col2 * col2 AS col2 FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT col0 NOT IN ( + col1 + col1 - + cor0.col2 * col0 * col0 ) OR ( col2 ) BETWEEN NULL AND - col0 * col2;
  - name: tab0

outputs:
  - name: q11290.out
    data: |
